import React from 'react'

const ProfileDataList = ({ item }) => {
  return(
    <li className="list">
      <div>
        <span className="item"> {item} </span>
        <span className="handle-delete" onClick={this.handleClick}> x </span>
      </div>
    </li>
  )
}

export default ProfileDataList
